    <script src="https://cdnjs.cloudflare.com/ajax/libs/clipboard.js/1.4.0/clipboard.min.js" integrity="sha512-iJh0F10blr9SC3d0Ow1ZKHi9kt12NYa+ISlmCdlCdNZzFwjH1JppRTeAnypvUez01HroZhAmP4ro4AvZ/rG0UQ==" crossorigin="anonymous" referrerpolicy="no-referrer"></script>

    <script>

        $(document).ready(function(){
            $('#frmTargetVideo').dropzone({
                url: '<?php echo e(route('settings.store')); ?>',
                paramName: "file", // The name that will be used to transfer the file
                maxFilesize: 2000,
                parallelUploads: 5,
                timeout: null,
                acceptedFiles: ".pdf,.docx,.txt,.doc",
                autoProcessQueue:true ,
                addRemoveLinks:true  ,
                init: function() {
                    var myDropzone = this;
                    $("#submit_video_section").click(function (e) {
                        e.preventDefault();
                        myDropzone.processQueue();
                    });
                    this.on('sending', function (file, xhr, formData) {
                        // Append all form inputs to the formData Dropzone will POST
                        var data = $('#frmTargetVideoInputs').serializeArray();
                        $.each(data, function (key, el) {
                            formData.append(el.name, el.value);
                        });

                    });

                    this.on('complete', function (file , response) {
                        console.log(response);

                    });

                    this.on('error', function(file, response) {
                        alert(response.message)
                    });

                },
                success:function(file, response) {
                    // alert('sss')
                    // alert(response.message)
                    console.log(response.message);

                    $('#dwnldLnk').html(response.message);
                    $('.progress').removeClass('d-none');
                    // $('#dwnldLnk').attr('href' , response.message)
                    // $('#dwnldLnk').show()

                    document.getElementById('dwnldLnk').style.display = 'block';

                }
            });


        });

    </script>

